import React from "react";
import { Card } from "semantic-ui-react";

const RecipeListItem = ({ recipe }) => {
  return (
    <Card>
      <img src={recipe.image_url} alt="thumbnail" style={{ height: 170 }} />
    </Card>
  );
};

export default RecipeListItem;
